import React, { Component } from 'react';
import './../CSS/Timeline.css'

let renderPost = () => {
    let post = [];
    for (let i=0; i< 3; i++){
        post.push(
            <div className="News">
                <h2>
                    Title 
                </h2>
                <div className="Article">
                    This is news.
                </div>
            </div>
        )
    }
    return post;
}

class Timeline extends Component{

    constructor(props){
        super(props);
        this.state = [];
    }


    render(){

        return(
            <>
            <table>
            {this.renderPost()}
            </table>


            </>
        )
    }

}

export default Timeline;
